export class Preview {

    constructor(type, size, filetype, caption, url, key, downloadUrl, filename) {
        this.type = type;
        this.size = size;
        this.filetype = filetype;
        this.caption = caption;
        this.url = url;
        this.key = key;
        this.downloadUrl = downloadUrl;
        this.filename = filename;
    }
}

